ton\r\n    Then The user should able to see an error message in alert window\r\n\r\n  Scenario: No error message displayed for empty code on try editor for Implementation using collections.deque\r\n    Given The user on Implementation using collection.deque in python page\r\n    When User clicks on run button with empty code\r\n    Then The user should not see any error message or alert\r\n\r\n  Scenario: Valid code on try editor for Implementation using collections.deque runs successfully\r\n    Given The user on Implementation using collection.deque in python page\r\n    When User writes valid code and clicks run button\r\n    Then The user should able to see output in the console\r\n\r\n  Scenario: Validate user can navigate to Implementation using collections.deque\r\n    Given The user is on Queue Details page\r\n    When The user click on Queue Operations\r\n    Then the user is navigated to Queue Operations Page\r\n\r\n  Scenario: Validate user can open try editor page from Implementation using collections.deque\r\n    Given The user is on Queue Operations page\r\n    When User clicks Try here link\r\n    Then User should navigate to tryEditor page\r\n\r\n  Scenario: Error message displayed for invalid code on try editor for Implementation using collections.deque\r\n    Given The user is on Queue Operations page\r\n    When User writes invalid code and clicks run button\r\n    Then The user should able to see an error message in alert window\r\n\r\n  Scenario: No error message displayed for empty code on try editor for Implementation using collections.deque\r\n    Given The user is on Queue Operations page\r\n    When User clicks on run button with empty code\r\n    Then The user should not see any error message or alert\r\n\r\n  Scenario: Valid code on try editor for Implementation using collections.deque runs successfully\r\n    Given The user is on Queue Operations page\r\n    When User writes invalid code and clicks run button\r\n    Then The user should ion page\r\n    Given The user is on the new user registration page\r\n   \r\nScenario Outline: New user registration page with all fields empty and Register button is clicked\r\n    When The user clicks Register button with all fields empty on registration form from sheetname \"<Sheetname>\" and row <RowNumber>\r\n    Then The error Please fill out this field appears below Username textbox\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | register  |         0 | \r\n    \r\n  Scenario Outline: New user registration page with only username entered\r\n    When The user clicks Register button after entering Username with other fields empty on registration form from sheetname \"<Sheetname>\" and row <RowNumber>\r\n    Then The error message Please fill out this field. appears below Password textbox\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | register  |         1 | \r\n    \r\n   \r\n  Scenario Outline: New user registration page with only username and password fields entered\r\n    When The user clicks Register button after entering Username and password with Password Confirmation field empty on registration form from sheetname \"<Sheetname>\" and row <RowNumber>\r\n    Then The error message Please fill out this field. appears below Password Confirmation textbox\r\n   Examples: \r\n      | Sheetname | RowNumber |\r\n      | register  |         2 |\r\n       \r\n  Scenario Outline: New user registration page with username entered with a space inbetween\r\n    When The user clicks Register button after entering a username with spacebar characters other than digits and symbols on registration form from sheetname \"<Sheetname>\" and row <RowNumber>\r\n    Then The user is displayed with error msg after entering invalid data and redirects to empty username textbox\r\n  Examples: \r\n      | Sheetname | RowNumber |\r\n      | register  |         3 |   \r\n   \r\n  Scenario Outline: New user registration page with valid username but only numeric password and confirm password\r\n    When The user clicks Register button after entering a password with only numeric data on registration form from sheetname \"<Sheetname>\" and row <RowNumber>\r\n    Then The user is displayed the appropriate error msg after entering invalid data and redirects to empty confirm password textbox\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | register  |         4 | \r\n      \r\n    \r\n  Scenario Outline: New user registration page with valid username but password and confirm password fields has less than eight characters\r\n    When The user clicks Register button after entering a Password with characters less than eight on registration form from sheetname \"<Sheetname>\" and row <RowNumber>\r\n    Then The user is displayed the appropriate error msg after entering invalid data and  redirects to empty password confirm textbox\r\n    Examples: \r\n      | Sheetname | RowNumber |\r\n      | register  |         5 | \r\n    \r\n   \r\n  Scenario Outline: New user registration page on registration with different passwords entered in password and confirm password fields\r\n    When The user clicks Register button after entering different passwords in Password and Password Confirmation fields form from sheetname \"<Sheetname>\" and row <RowNumber>\r\n    Then The user is displayed with a warning message password_mismatch:The two password fields didnt match.\r\n   Examples: \r\n      | Sheetname | RowNumber |\r\n      | register  |         6 |  \r\n   \r\n  Scenario Outline: New user registration page with all valid credentials entered\r\n    When The user clicks Register button after user fills registration form from sheetname \"<Sheetname>\" and row <RowNumber> \r\n    Then The user is redirected to Home Page of DS Algo with success message - New Account Created. You are logged in as username on the DS Algo Home Page\r\n     Examples: \r\n      | Sheetname | RowNumber |\r\n      | register  |         7 | \r\n tryEditor page\r\n\r\n  Scenario: Error message displayed for invalid code on try Editor for Implementation page\r\n    Given The user is on the Implementation page\r\n    When User writes invalid code and clicks run button\r\n    Then The user should able to see an error message in alert window\r\n\r\n  Scenario: No error message displayed for empty code on try editor for Implementation page\r\n    Given The user is on the Implementation page\r\n    When User clicks on run button with empty code\r\n    Then The user should not see any error message or alert\r\n\r\n  Scenario: Valid code on try editor for Implementation runs successfully\r\n    Given The user is on the Implementation page\r\n    When User writes valid code and clicks run button\r\n    Then The user should able to see output in the console\r\n    \r\n    Scenario: Validate user can navigate to Applications page\r\n    Given The user is on the stack details page\r\n    When The user click on Applications link\r\n    Then the user is navigated to Applications page \r\n    \r\n  Scenario: Validate user can click on Try here link from Applications page\r\n    Given The user is on the Applications page\r\n    When User clicks Try here link\r\n    Then User should navigate to tryEditor page\r\n\r\n  Scenario: Error message displayed for invalid code on try Editor for Applications page\r\n    Given The user is on the Applications page\r\n    When User writes invalid code and clicks run button\r\n    Then The user should able to see an error message in alert window\r\n\r\n  Scenario: No error message displayed for empty code on try editor for Applications page\r\n    Given The user is on the Applications page\r\n    When User clicks on run button with empty code\r\n    Then The user should not see any error message or alert\r\n\r\n  Scenario: Valid code on try editor for Applications runs successfully\r\n    Given The user is on the Applications page\r\n    When User writes valid code and clicks run button\r o: Overview of Trees\r\nGiven The user is on the Overview of Trees page\r\nWhen The user clicks Try Here button\r\nThen The user is redirected to a page having Editor and run button\r\n\r\nScenario: Try Here Editor page with empty code\r\nGiven The user is on the Editor page of Overview of Trees page\r\nWhen The user writes no code inside editor window and clicks on Run button\r\nThen Nothing happens to the Editor page and no error message is displayed\r\n\r\n\r\nScenario: Try Here Editor page with valid data\r\nGiven The user is on the Editor page of Overview of Trees page\r\nWhen The user writes the valid python code and clicks on Run button\r\nThen The user is able to see the output inside the console.\r\n\r\nScenario: Try Here Editor page with invalid data\r\nGiven The user is on the Editor page of Overview of Trees page\r\nWhen The user writes the invalid python code and clicks on Run button\r\nThen The user see error msg in alert window\r\n\r\nScenario: Overview of Trees\r\n\r\nGiven The user is on the Overview of Trees page\r\nWhen The user clicks Terminologies link\r\nThen The user is redirected to Terminologies page\r\n\r\n\r\nScenario: Terminologies\r\nGiven The user is on the Terminologies page\r\nWhen The user clicks Try Here button\r\nThen The user is redirected to a page having Editor and run button\r\n\r\nScenario: Try Here Editor page with empty code\r\nGiven The user is on the Editor page of Terminologies page\r\nWhen The user writes no code inside editor window and clicks on Run button  \r\nThen Nothing happens to the Editor page and no error message is displayed\r\n\r\nScenario: Try Here Editor page with valid data\r\n\r\nGiven The user is on the Editor page of Terminologies page\r\nWhen The user writes the valid python code and clicks on Run button\r\nThen The user is able to see the output inside the console.\r\n\r\nScenario: Try Here Editor page with invalid data\r\n\r\nGiven The user is on the Editor page of Terminologies page\r\nWhen The user
